import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

// AUTH
import LoginPage from "../pages/LoginPage";
import ProtectedRoute from "./ProtectedRoute";

// ADMIN LAYOUT + ADMIN PAGES
import ProtectedLayout from "../layouts/ProtectedLayout";
import DashboardPage from "../pages/admin/DashboardPage";
import EmployeesPage from "../pages/admin/EmployeesPage";
import DepartmentsPage from "../pages/admin/DepartmentsPage";
import DesignationsPage from "../pages/admin/DesignationsPage";
import DocumentsPage from "../pages/admin/DocumentsPage";
import RecruitmentPage from "../pages/admin/RecruitmentPage";
import PerformanceReviewsPage from "../pages/admin/PerformanceReviewsPage";
import AnnouncementsPage from "../pages/admin/AnnouncementsPage";
import SettingsPage from "../pages/admin/SettingsPage";

// EMPLOYEE LAYOUT + PAGES
import EmployeeLayout from "../components/EmployeeLayout";
import EmployeeDashboard from "../pages/employees/DashboardPage";
import AttendancePage from "../pages/employees/AttendancePage";
import LeavesPage from "../pages/employees/LeavesPage";
import SalariesPage from "../pages/employees/SalariesPage";     // FIXED
import PayslipsPage from "../pages/employees/PayslipsPage";     // FIXED
import ProfilePage from "../pages/employees/ProfilePage";       // FIXED

const AppRouter = () => (
  <BrowserRouter>
    <Routes>
      {/* LOGIN */}
      <Route path="/login" element={<LoginPage />} />

      {/* EMPLOYEE PORTAL */}
      <Route
        path="/dashboard"
        element={
          <ProtectedRoute roles={[4]}>
            <EmployeeLayout>
              <EmployeeDashboard />
            </EmployeeLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/attendance"
        element={
          <ProtectedRoute roles={[4]}>
            <EmployeeLayout>
              <AttendancePage />
            </EmployeeLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/leaves"
        element={
          <ProtectedRoute roles={[4]}>
            <EmployeeLayout>
              <LeavesPage />
            </EmployeeLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/salary"
        element={
          <ProtectedRoute roles={[4]}>
            <EmployeeLayout>
              <SalariesPage />
            </EmployeeLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/payslips"
        element={
          <ProtectedRoute roles={[4]}>
            <EmployeeLayout>
              <PayslipsPage />
            </EmployeeLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/profile"
        element={
          <ProtectedRoute roles={[4]}>
            <EmployeeLayout>
              <ProfilePage />
            </EmployeeLayout>
          </ProtectedRoute>
        }
      />

      {/* ADMIN PORTAL */}
      <Route
        path="/admin/dashboard"
        element={
          <ProtectedRoute roles={[1, 2, 3]}>
            <ProtectedLayout>
              <DashboardPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      <Route
        path="/admin/employees"
        element={
          <ProtectedRoute roles={[1, 2]}>
            <ProtectedLayout>
              <EmployeesPage />
            </ProtectedLayout>
          </ProtectedRoute>
        }
      />

      {/* Add more admin routes here... */}

      {/* DEFAULT */}
      <Route path="*" element={<Navigate to="/dashboard" replace />} />
    </Routes>
  </BrowserRouter>
);

export default AppRouter;
